import Link from 'next/link';
import imgs from '../imgs/img';
import styles from './header.module.scss';

const Header = () => {
    return (
        <header>
            <div className={styles.header}>
                <img src={ imgs.headerLogo } />
            </div>
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/about">
                <a>About</a>
            </Link>
        </header>
    )
}

export default Header;
